/* Procedure structure for procedure `get_username` */

/*!50003 DROP PROCEDURE IF EXISTS  `get_username` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `get_username`()
BEGIN
    TRUNCATE TABLE tb_delapan;
    SELECT DISTINCT username, `day`, `durations` AS q FROM rekap
    WHERE rekap.`durations` >=8 AND rekap.`durations` <=10;
    
    END */$$
DELIMITER ;

